import styled from "styled-components";

export const LoginContainer = styled.div`
  width: 360px;
  height: 90%;
  border-radius: 30px;
  background-color: #f9f9f9;
  box-shadow: 0px 0px 20px #d5d5d5;
  padding: 2px; 
  position: fixed;
  bottom: 0;
`;

const Login = () => {
  return (
    <LoginContainer>

    </LoginContainer>
  );
};

export default Login;
